<?php

namespace Tests\Fixtures;

use App\Repositories\CollectionRepository;
use App\Repositories\TextRepository;

class CreatePoemRequest
{
    public function __construct(CollectionRepository $collections, TextRepository $texts)
    {
        $this->collections = $collections;
        $this->texts = $texts;
    }

    public function get()
    {
        $collection = $this->collections->random();
        $collection->texts()->attach($this->texts->random(3)->pluck('id'));

        return [
                'poem' => [
                'title' => 'Just a test poem',
                'author' => 'Mike Clump',
                'email' => 'test@example.com',
                'json' => json_encode([]),
                'collection_id' => $collection->id,
                'text_id' => $collection->texts()->inRandomOrder()->first()->id,
            ],
            'base64' => 'data:image/png;base64,',
        ];
    }
}
